        <input
          autoFocus
          autoComplete='off'
          name='searchInput'
          placeholder='Search for the langugae you are willing to learn'
          onChange={(event) =>
            this.props.onSearchQueryChange(event.target.value)
          }
        />
        {/* <legend>SEARCH</legend> */}
        {/* </fieldset> */}
      </div>
    );
  }
}
